import React from "react";
import "../ExamMaster/Mainpage.css";

const Mainpage = () => {
  return(
  
  <div className="row">

      <div className="col-3"></div>
      <div className="col-6  div2">  
          <div className="div21">
          <button className="btn btn-primary btn1">Create Exam</button>
          </div>
          <div className="div21">
          <button className="btn btn-primary btn1">Register a User</button>
          </div>
          <div className="div21">
          <button className="btn btn-primary btn1">Update Exam</button>
          </div>

      </div>
      <div className="col-3"></div>

  </div>
  
  ); 
};

export default Mainpage;
